import React, {Component} from 'react';

const ProfileData = (props) => {
    return (
        <div>
            <div>Имя пользователя: {props.userName}</div>
            <div>День рождения: {props.birthDay}</div>
            <div>Город: {props.city}</div>
            <div>Образование: {props.aducation}</div>
            <div>Веб сайт: {props.webSite}</div>
        </div>
    )
}

export default ProfileData
